<script>
/* ================= AUTENTICA√á√ÉO ================= */
const AUTH_ADMIN_EMAIL = "adituramacatedral@gmail.com";
const AUTH_ALLOWED_KEY = "AUTH_ALLOWED_EMAILS_V1";

/* Lista de emails autorizados */
function authGetAllowed(){
  try{
    const arr = JSON.parse(localStorage.getItem(AUTH_ALLOWED_KEY) || "[]");
    if(Array.isArray(arr) && arr.length){
      return arr.map(s=>String(s||"").trim().toLowerCase()).filter(Boolean);
    }
  }catch(e){}
  const init = [AUTH_ADMIN_EMAIL.toLowerCase()];
  localStorage.setItem(AUTH_ALLOWED_KEY, JSON.stringify(init));
  return init;
}

/* Salva lista de emails autorizados */
function authSetAllowed(arr){
  const clean = (arr||[])
    .map(s=>String(s||"").trim().toLowerCase())
    .filter(Boolean)
    .filter((v,i,a)=>a.indexOf(v)===i);
  if(!clean.includes(AUTH_ADMIN_EMAIL.toLowerCase())) clean.unshift(AUTH_ADMIN_EMAIL.toLowerCase());
  localStorage.setItem(AUTH_ALLOWED_KEY, JSON.stringify(clean));
  return clean;
}

/* Overlay de login */
function authMakeOverlay(){
  const ov = document.createElement("div");
  ov.id = "authOverlay";

  /* Overlay tela cheia */
  ov.style.position = "fixed";
  ov.style.inset = "0";
  ov.style.zIndex = "999999";
  ov.style.background = "rgba(0,0,0,.85)";
  ov.style.display = "flex";
  ov.style.alignItems = "center";
  ov.style.justifyContent = "center";
  ov.style.padding = "16px";

  ov.innerHTML = `
    <!--
      FIX DEFINITIVO:
      For√ßa width:100% apenas dentro do overlay
      para neutralizar o input{width:220px} global
      sem quebrar o restante do sistema
    -->
    <style>
      #authOverlay input,
      #authOverlay button{
        width:100% !important;
        box-sizing:border-box !important;
      }
    </style>

    <!-- Caixa do login -->
    <div style="
      width:360px;
      max-width:100%;
      background:#111;
      border:1px solid rgba(255,255,255,.12);
      border-radius:12px;
      padding:16px;
      color:#fff;
      font-family:Arial, Helvetica, sans-serif
    ">
      <div style="
        font-size:18px;
        font-weight:700;
        text-align:center;
        margin-bottom:10px
      ">
        Acesso restrito
      </div>

      <!-- Email -->
      <input
        id="authEmail"
        type="email"
        placeholder="Email"
        style="
          padding:10px;
          border-radius:10px;
          border:1px solid rgba(255,255,255,.15);
          background:#0b0b0b;
          color:#fff;
          outline:none;
          margin:6px 0
        "
      >

      <!-- Senha -->
      <input
        id="authPass"
        type="password"
        placeholder="Senha"
        style="
          padding:10px;
          border-radius:10px;
          border:1px solid rgba(255,255,255,.15);
          background:#0b0b0b;
          color:#fff;
          outline:none;
          margin:6px 0
        "
      >

      <!-- Bot√£o entrar -->
      <button
        id="authBtnLogin"
        style="
          padding:10px;
          border-radius:10px;
          border:0;
          background:#2563eb;
          color:#fff;
          font-weight:700;
          cursor:pointer;
          margin-top:8px
        "
      >
        Entrar
      </button>

      <!-- Mensagem de erro -->
      <div
        id="authMsg"
        style="
          min-height:18px;
          color:#ff7b7b;
          text-align:center;
          margin-top:10px
        "
      ></div>
    </div>
  `;

  document.body.appendChild(ov);
  return ov;
}

/* ================= PAINEL ADMIN ================= */
function authMakeAdminPanel(){
  const box = document.createElement("div");
  box.id = "authAdminPanel";
  box.style.position = "fixed";
  box.style.right = "10px";
  box.style.bottom = "10px";
  box.style.zIndex = "999998";
  box.style.background = "rgba(0,0,0,.82)";
  box.style.color = "#fff";
  box.style.border = "1px solid rgba(255,255,255,.12)";
  box.style.borderRadius = "12px";
  box.style.padding = "10px";
  box.style.fontFamily = "Arial, Helvetica, sans-serif";
  box.style.fontSize = "12px";
  box.style.width = "320px";

  box.innerHTML = `
    <div style="display:flex;justify-content:space-between;align-items:center;margin-bottom:8px">
      <div style="font-weight:700">ADMIN</div>
      <button id="authBtnLogout" style="border:0;border-radius:10px;padding:6px 10px;background:#ef4444;color:#fff;cursor:pointer;font-weight:700">Sair</button>
    </div>

    <div style="margin-bottom:6px">Emails autorizados (um por linha):</div>

    <textarea
      id="authAllowedList"
      style="
        width:100%;
        height:120px;
        resize:none;
        border-radius:10px;
        border:1px solid rgba(255,255,255,.15);
        background:#0b0b0b;
        color:#fff;
        padding:8px;
        outline:none;
        box-sizing:border-box;
      "
    ></textarea>

    <div style="display:flex;gap:8px;margin-top:8px">
      <button id="authBtnSaveAllowed" style="flex:1;border:0;border-radius:10px;padding:8px;background:#22c55e;color:#111;cursor:pointer;font-weight:800">Salvar lista</button>
      <button id="authBtnResetPass" style="flex:1;border:0;border-radius:10px;padding:8px;background:#f59e0b;color:#111;cursor:pointer;font-weight:800">Reset senha</button>
    </div>

    <div id="authAdminMsg" style="min-height:16px;margin-top:8px;color:#a7f3d0"></div>
  `;

  document.body.appendChild(box);
  return box;
}

/* ================= BOOT DE AUTENTICA√á√ÉO ================= */
async function authBoot(){
  const waitFB = () => new Promise(res=>{
    const t0 = Date.now();
    (function tick(){
      if(window.__FB && window.__FB.auth) return res();
      if(Date.now()-t0 > 15000) return res();
      setTimeout(tick, 50);
    })();
  });
  await waitFB();

  if(!(window.__FB && window.__FB.auth)) return;

  const { auth, onAuthStateChanged, signInWithEmailAndPassword, signOut, sendPasswordResetEmail } = window.__FB;

  const ov = authMakeOverlay();
  const elEmail = ov.querySelector("#authEmail");
  const elPass  = ov.querySelector("#authPass");
  const elMsg   = ov.querySelector("#authMsg");
  const btnLogin = ov.querySelector("#authBtnLogin");

  const setMsg = (t)=>{ elMsg.textContent = t || ""; };

  btnLogin.onclick = async ()=>{
    setMsg("");
    try{
      await signInWithEmailAndPassword(auth, elEmail.value.trim(), elPass.value);
    }catch{
      setMsg("Login inv√°lido.");
    }
  };

  let adminPanel = null;

  onAuthStateChanged(auth, async (user)=>{
    if(!user){
      try{ if(!document.getElementById("authOverlay")) document.body.appendChild(ov); }catch(e){}
      return;
    }

    const email = String(user.email||"").trim().toLowerCase();
    if(!authGetAllowed().includes(email)){
      try{ await signOut(auth); }catch(e){}
      setMsg("Acesso negado.");
      return;
    }

    try{ ov.remove(); }catch(e){}

    if(email === AUTH_ADMIN_EMAIL.toLowerCase()){
      if(!adminPanel) adminPanel = authMakeAdminPanel();

      const ta = adminPanel.querySelector("#authAllowedList");
      const msg = adminPanel.querySelector("#authAdminMsg");

      ta.value = authGetAllowed().join("\n");

      adminPanel.querySelector("#authBtnSaveAllowed").onclick = ()=>{
        authSetAllowed(ta.value.split(/\r?\n/));
        msg.textContent = "Lista salva.";
        setTimeout(()=>msg.textContent="",1500);
      };

      adminPanel.querySelector("#authBtnResetPass").onclick = async ()=>{
        const emailAlvo = prompt("Digite o email do usu√°rio para resetar a senha:");
        if(!emailAlvo) return;
        try{
          await sendPasswordResetEmail(auth, emailAlvo.trim());
          msg.textContent = "Email de reset enviado.";
        }catch{
          msg.textContent = "Falha ao enviar reset.";
        }
        setTimeout(()=>msg.textContent="",2000);
      };

      adminPanel.querySelector("#authBtnLogout").onclick = async ()=>{
        try{ await signOut(auth); }catch(e){}
        try{ adminPanel.remove(); }catch(e){}
        adminPanel = null;
      };
    }
  });
}

if(document.readyState === "loading"){
  document.addEventListener("DOMContentLoaded", authBoot, { once:true });
}else{
  authBoot();
}

/* ================= PARSER ================= */
function parseLista(raw){
  const arr = [];

  raw
    .split(/\r?\n/)
    .map(l => l.replace(/\s+/g, " ").trim())
    .forEach(linha => {
      if(!linha) return;

      for(const cargo of CARGOS){
        const rx = new RegExp(` ${cargo}$`, "i");
        if(rx.test(linha)){
          const nome = linha.replace(rx, "").trim();
          arr.push({
            nome,
            cargo,
            sel: false,
            valor: 0
          });
          break;
        }
      }
    });

  return arr;
}

/* ================= STORAGE ================= */
let BD = JSON.parse(localStorage.getItem("BD_LISTA")) || parseLista(RAW_LISTA);
let SAIDAS = JSON.parse(localStorage.getItem("BD_SAIDAS")) || [];

/* LIMPA SELE√á√ÉO AO INICIAR */
BD.forEach(p=>{
  p.sel = false;
  if(p._pendenteSel) delete p._pendenteSel;
});

const salvar = () => localStorage.setItem("BD_LISTA", JSON.stringify(BD));
const salvarSaidas = () => localStorage.setItem("BD_SAIDAS", JSON.stringify(SAIDAS));
salvar();
salvarSaidas();

/* ================= HELPERS ================= */
const norm = s => (s || "")
  .toLowerCase()
  .normalize("NFD")
  .replace(/[\u0300-\u036f]/g, "");

const moneyFmt = n =>
  new Intl.NumberFormat("pt-BR", { style: "currency", currency: "BRL" })
    .format(Number(n) || 0)
    .replace(/\u00A0/g, "");

const parseMoney = str => {
  const digits = (str || "").replace(/[^\d]/g, "");
  return digits ? (parseInt(digits, 10) / 100) : 0;
};

function limparBusca() {
  buscaEl.value = "";
  resEl.innerHTML = "";
  resEl.style.display = "none";
  buscaEl.focus();
}

/* ================= BUSCA ================= */
function renderBusca(){
  const f = norm(buscaEl.value);
  resEl.innerHTML = "";
  if(!f){ resEl.style.display="none"; return; }

  const itens = BD
    .filter(p => norm(p.nome).includes(f))
    .sort((a,b)=>a.nome.localeCompare(b.nome,"pt-BR"));

  if(!itens.length){
    resEl.style.display="block";
    resEl.textContent="Nenhum nome encontrado.";
    return;
  }

  itens.forEach(p=>{
    const d=document.createElement("div");
    d.className="item";

    const c=document.createElement("input");
    c.type="checkbox";
    c.checked=!!p.sel;

    const s=document.createElement("span");
    s.textContent=p.nome;

    const v=document.createElement("input");
    v.type="text";
    v.inputMode="numeric";
    v.className="valor";
    v.placeholder="R$0,00";
    v.value = (p.valor && p.valor > 0) ? moneyFmt(p.valor) : "";

    v.oninput=()=>{
      const num = parseMoney(v.value);
      v.value = num > 0 ? moneyFmt(num) : "";
      p.valor = num;
      salvar();
    };

    c.onchange=()=>{
      if(c.checked){
        p._pendenteSel = true;
        setTimeout(()=>v.focus(), 0);
      }else{
        p.sel=false;
        delete p._pendenteSel;
        salvar();
        limparBusca();
      }
    };

    const confirmarSePendente = ()=>{
      if(!p._pendenteSel) return;

      if(p.valor && p.valor > 0){
        p.sel = true;
        delete p._pendenteSel;
        salvar();
        limparBusca();
      }else{
        p.sel = false;
        c.checked = false;
        delete p._pendenteSel;
        salvar();
        v.focus();
      }
    };

    v.onblur = confirmarSePendente;
    v.onkeydown = e=>{
      if(e.key === "Enter"){
        e.preventDefault();
        confirmarSePendente();
      }
    };

    const b=document.createElement("span");
    b.className="badge";
    b.textContent=p.cargo;

    d.append(c,s,v,b);
    resEl.appendChild(d);
  });

  resEl.style.display="block";
}

buscaEl.oninput = renderBusca;

/* ===== ENTER PARA SELECIONAR QUANDO HOUVER 1 RESULTADO ===== */
buscaEl.addEventListener("keydown", e=>{
  if(e.key !== "Enter") return;

  const itens = resEl.querySelectorAll(".item");
  if(itens.length !== 1) return;

  const checkbox = itens[0].querySelector("input[type='checkbox']");
  if(!checkbox) return;

  checkbox.checked = true;
  checkbox.dispatchEvent(new Event("change"));
});

  BD.push({nome:nome.trim(),cargo,sel:true,valor:0});
  salvar();
  renderBusca();
};

};

function adicionarSaida(descricao, valor){
  if(!descricao) return;
  const v = Number(valor);
  if(!isFinite(v) || v <= 0) return;

  SAIDAS.push({ descricao: descricao.trim(), valor: v });
  salvarSaidas();
}

btnSaida.onclick = () => {
  const descricao = prompt("Descri√ß√£o da sa√≠da (ex: Mercado, Farm√°cia, Plano de Sa√∫de):");
  if(!descricao) return;

  const valorStr = prompt("Valor da sa√≠da (ex: 350,00):");
  if(!valorStr) return;

  const valor = parseMoney(valorStr);
  if(valor <= 0){ alert("Valor inv√°lido."); return; }

  adicionarSaida(descricao, valor);
};

/* ================= PDF FINANCEIRO (ENTRADAS + SA√çDAS + SALDO) ================= */
btnFin.onclick=()=>{
  const jsPDF = window.jspdf.jsPDF;
  const pdf = new jsPDF();

  const periodo = prompt("Informe o per√≠odo do relat√≥rio (ex: Julho/2025):");
  if(!periodo) return;

  let y = 25;

  pdf.setFont("helvetica","bold");
  pdf.setFontSize(16);
  pdf.setTextColor(0,0,0);
  pdf.text("RELAT√ìRIO FINANCEIRO", 105, y, {align:"center"});

  y += 8;
  pdf.setFont("helvetica","normal");
  pdf.setFontSize(12);
  pdf.text(`Per√≠odo: ${periodo}`, 105, y, {align:"center"});

  y += 15;

  /* ===== ENTRADAS ===== */
  pdf.setFont("helvetica","bold");
  pdf.setFontSize(14);
  pdf.setTextColor(0,0,0);
  pdf.text("ENTRADAS", 20, y);
  y += 8;

  let totalE = 0;

  const entradas = BD
    .filter(p => (Number(p.valor) || 0) > 0)
    .sort((a,b)=>a.nome.localeCompare(b.nome,"pt-BR"));

  if(!entradas.length){
    pdf.setFont("helvetica","italic");
    pdf.setFontSize(11);
    pdf.text("Nenhuma entrada registrada.", 20, y);
    y += 6;
  }else{
    pdf.setFont("helvetica","normal");
    pdf.setFontSize(11);

    entradas.forEach(p=>{
      if(y > 280){ pdf.addPage(); y = 20; }
      pdf.text(p.nome.toUpperCase(), 20, y);
      pdf.text(moneyFmt(p.valor), 190, y, {align:"right"});
      totalE += Number(p.valor) || 0;
      y += 6;
    });
  }

  y += 6;
  pdf.setFont("helvetica","bold");
  pdf.text("TOTAL DE ENTRADAS: " + moneyFmt(totalE), 190, y, {align:"right"});

  y += 14;

  /* ===== SA√çDAS ===== */
  pdf.setFontSize(14);
  pdf.text("SA√çDAS", 20, y);
  y += 8;

  let totalS = 0;

  if(!SAIDAS.length){
    pdf.setFont("helvetica","italic");
    pdf.setFontSize(11);
    pdf.text("Nenhuma sa√≠da registrada.", 20, y);
    y += 6;
  }else{
    pdf.setFont("helvetica","normal");
    pdf.setFontSize(11);

    SAIDAS.forEach(s=>{
      if(y > 280){ pdf.addPage(); y = 20; }
      const val = Number(s.valor) || 0;
      pdf.text(String(s.descricao || "").trim(), 20, y);
      pdf.text(moneyFmt(val), 190, y, {align:"right"});
      totalS += val;
      y += 6;
    });
  }

  y += 6;
  pdf.setFont("helvetica","bold");
  pdf.setTextColor(0,0,0);
  pdf.text("TOTAL DE SA√çDAS: " + moneyFmt(totalS), 190, y, {align:"right"});

  y += 14;

  /* ===== SALDO ===== */
  const saldo = totalE - totalS;

  pdf.setFontSize(14);
  pdf.setFont("helvetica","bold");
  if(saldo < 0){
    pdf.setTextColor(200,0,0);
  }else{
    pdf.setTextColor(0,0,0);
  }

  pdf.text("SALDO FINAL: " + moneyFmt(saldo), 190, y, {align:"right"});
  pdf.save("relatorio_financeiro.pdf");
};

const GOOGLE_SCOPES = "https://www.googleapis.com/auth/drive.file";

let gapiInited = false;
let gisInited = false;

/* ===== INIT GOOGLE ===== */
window.addEventListener("load", () => {
  if (window.gapi) gapiLoaded();
  if (window.google && google.accounts) gisLoaded();
});

function gapiLoaded(){
  gapi.load("client", async () => {
    await gapi.client.init({
      apiKey: GOOGLE_API_KEY,
      discoveryDocs: ["https://www.googleapis.com/discovery/v1/apis/drive/v3/rest"]
    });
    gapiInited = true;
  });
}

function gisLoaded(){
  tokenClient = google.accounts.oauth2.initTokenClient({
    client_id: GOOGLE_CLIENT_ID,
    scope: GOOGLE_SCOPES,
    callback: () => {}
  });
  gisInited = true;
}

function ensureGoogleReady(){
  if (!gapiInited) gapiLoaded();
  if (!gisInited) gisLoaded();
}

function requestAccessToken(){
  return new Promise((resolve, reject) => {
    if (!tokenClient) return reject();
    tokenClient.callback = (resp) => {
      if (resp?.access_token){
        gapi.client.setToken({ access_token: resp.access_token });
        resolve(resp.access_token);
      } else {
        reject();
      }
    };
    tokenClient.requestAccessToken({ prompt: "" });
  });
}

async function getAccessToken(){
  ensureGoogleReady();
  const t = gapi.client.getToken();
  if (t?.access_token) return t.access_token;
  return await requestAccessToken();
}

async function driveFindFileIdByName(nomeArquivo){
  const q = [
    `name='${nomeArquivo.replace(/'/g,"\\'")}'`,
    `'${GOOGLE_DRIVE_FOLDER_ID}' in parents`,
    "trashed=false"
  ].join(" and ");

  const res = await gapi.client.drive.files.list({
    q,
    fields: "files(id)",
    pageSize: 1
  });

  return res.result.files?.[0]?.id || null;
}

async function driveUploadOrUpdateJson(nomeArquivo, jsonText){
  await getAccessToken();

  const boundary = "-------314159265358979323846";
  const fileId = await driveFindFileIdByName(nomeArquivo);

  const metadata = fileId
    ? { name: nomeArquivo }
    : { name: nomeArquivo, parents:[GOOGLE_DRIVE_FOLDER_ID] };

  const body = [
    `--${boundary}`,
    "Content-Type: application/json; charset=UTF-8",
    "",
    JSON.stringify(metadata),
    `--${boundary}`,
    "Content-Type: application/json; charset=UTF-8",
    "",
    jsonText,
    `--${boundary}--`,
    ""
  ].join("\r\n");

  const url = fileId
    ? `https://www.googleapis.com/upload/drive/v3/files/${fileId}?uploadType=multipart`
    : "https://www.googleapis.com/upload/drive/v3/files?uploadType=multipart";

  await fetch(url, {
    method: fileId ? "PATCH" : "POST",
    headers: {
      Authorization: `Bearer ${gapi.client.getToken().access_token}`,
      "Content-Type": `multipart/related; boundary=${boundary}`
    },
    body
  });
}
